import "../styles/home.css";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <div className="home">
      <a href="app.js">
        <h2>Home</h2>
      </a>
      <Link className='btn btn'></Link>
    </div>
  );
};

export default Home;
